import{_ as s}from"./plugin-vue_export-helper-c27b6911.js";import{o as r,c as h,d as i,a as e,b as a,e as t}from"./app-b43ca6bb.js";const d="/assets/imgs/misc/20230610-1.png",n={},o=e("h1",{id:"日记02",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#日记02","aria-hidden":"true"},"#"),a(" 日记02")],-1),p=e("h2",{id:"下辈子不学英语了",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#下辈子不学英语了","aria-hidden":"true"},"#"),a(" 下辈子不学英语了")],-1),c=e("p",null,"寄！",-1),l=e("p",null,"先放首歌，好听。",-1),_=e("h6",{id:"在雨中独自舞蹈",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#在雨中独自舞蹈","aria-hidden":"true"},"#"),a(),e("em",null,[e("s",null,"在雨中独自舞蹈？")])],-1),m=e("iframe",{frameborder:"no",border:"0",marginwidth:"0",marginheight:"0",width:"330",height:"86",src:"//music.163.com/outchain/player?type=2&id=399552068&auto=1&height=66"},null,-1),u=t('<p>早上醒来，又因为一些原因不爽了一通。 <br>行吧。这宿舍是一秒钟也呆不下去了。</p><h2 id="于是写论文" tabindex="-1"><a class="header-anchor" href="#于是写论文" aria-hidden="true">#</a> 于是写论文</h2><p>一开始以为自己能在一天之内写完，写着写着发现自己想多了。 <br>这三千五百词的含金量比两学期的英语课含金量都高，<s><strong>什么是长篇大论的废话的含金量啊！</strong></s></p><h2 id="下午" tabindex="-1"><a class="header-anchor" href="#下午" aria-hidden="true">#</a> 下午</h2><p>有些困，去操场上转了两圈。在操场上看到了演出用的玩意（后来才知道是音乐livehouse），并不知道是干什么用的。</p><p>看到了天空中的阴沉的积雨云，逐渐占据了半个天空。此时我还不知道这意味着接下来将会发生什么。</p><h2 id="庞大的积雨云总是给我以一种-未知的、处于高位的巨大、混沌的存在-的感觉-更像一场狂野的梦、不明的存在" tabindex="-1"><a class="header-anchor" href="#庞大的积雨云总是给我以一种-未知的、处于高位的巨大、混沌的存在-的感觉-更像一场狂野的梦、不明的存在" aria-hidden="true">#</a> 庞大的积雨云总是给我以一种“未知的、处于高位的巨大、混沌的存在”的感觉，更像一场狂野的梦、不明的存在</h2><h2 id="傍晚" tabindex="-1"><a class="header-anchor" href="#傍晚" aria-hidden="true">#</a> 傍晚</h2><p>受不了了，想把世界一拳打爆.jpg <br>忽然想起或许可以试试出去住酒店，于是立马下单，290一晚。 <br><s>疑似有些奢侈了</s><br>还行。</p><p>但是走到路上忽然开始下超级暴雨。<s>哦，太好了</s></p><p>群里的1999玩家们<s>9批</s>开始狂喜，除了我<s>因为只有我在真正淋雨</s>。</p><p><s>但是暴雨确实好看，如果不是你在淋雨的话。</s><br><s>淋雨也好看</s></p><p>确实好看，喜欢地狱一般的阴沉的天空和神秘的、雾状的雨帘，和在无数雨滴和水雾之间折射的车头灯发出的炫目的光。</p><p>等到了酒店已经全部湿透了，并且酒店里还没有烘干衣服的机器。好吧。</p><p><s>试图用吹风机烘干裤子结果把裤子烧了个洞这件事是可以说的吗</s></p><p><s>又是五个小时的便秘论文时间。</s><br> 写到十二点，发现自己似乎只写了3500词的三分之一。 <s>急了。</s> <s>yj你真做的出来啊（不是）</s></p><h2 id="要命" tabindex="-1"><a class="header-anchor" href="#要命" aria-hidden="true">#</a> 要命</h2><p>那行吧，熬夜赶论文。<s>又是四个半小时的坐牢时间。</s><br><s>虽然到了后半夜已经能很明显的感受到手和脑子都不怎么听使唤了。</s></p><p>最近很喜欢的xp是机娘。<s>深夜幻想时间。</s></p><p>先放一张机娘在这里。 <img src="'+d+'" alt="可爱机娘" loading="lazy"></p><p>其实不管怎么想，机娘都是一种神奇而且美妙的存在。拥有着由钢铁、金属和塑料构成的躯体，代码和电流构成的意识，超乎外表的（物理方面的）力量，但却对情感无比的陌生与感到费解。</p><p><s>为什么我不可以是机娘</s> <s>是个机器人也行，这样再怎么熬夜就不怕困了</s> <s>你妈的，一拳把世界打爆</s></p><h2 id="算了-不发电了" tabindex="-1"><a class="header-anchor" href="#算了-不发电了" aria-hidden="true">#</a> 算了，不发电了</h2><p>写到临晨四点终于把这个b论文给写完了。算下来，从前一天的下午三点到第二天的凌晨四点，这个b论文一共花去了我13个小时，以及剥夺了我四个小时的睡眠。</p><p><s>而且这个论文也不一定有人会认真看。</s></p><p>算了，还是一拳打爆世界吧。 <br>就这样了。</p><p>再放一首喜欢的曲子。</p>',27),b=e("iframe",{frameborder:"no",border:"0",marginwidth:"0",marginheight:"0",width:"330",height:"86",src:"//music.163.com/outchain/player?type=2&id=1492827692&auto=0&height=66"},null,-1);function f(g,x){return r(),h("div",null,[o,p,c,i(" more "),l,_,m,u,b])}const N=s(n,[["render",f],["__file","20230610.html.vue"]]);export{N as default};
